import './CartProduct.scss';

export const CartProduct = () => (
    <div className="CartProduct">
     <div className="CartProduct-Image">
       <img classNames="image-cart" src="./img/phones-11-pro/iphone-11-pro-gold-1.jpg" alt="Iphone"/>
     </div>
    </div>
)
